window.bookSummaryJSON = "<p>Go into Hell, the hot demons said. </p> <p>It’ll be no big deal, they said. </p> <p>I was only supposed to walk through a Hellish Ring or two so we could find out my demonic origin. Easy peasy, Right? Wrong. </p> <p>Now I’m alone, locked up in some freak’s dungeon, and mourning the loss of my demons.</p> <p>Could they have done the impossible and survived the attack? Can they find me here? I don’t even know where here is. And...why the hell do I have wings?</p> <p>I don’t have time for this shit. I need to figure out what I am, where I am, and how to get out of here. Because I have a Hellgate to guard and my demons to search for, and nobody is going to stand in my way. Not even the Devil himself.</p>"; 
